const SWAPI_ROOT = 'https://swapi.dev/api/';
const SWAPI_PEOPLE = 'people';

export const getApiResources = () => {
    fetch(SWAPI_ROOT+SWAPI_PEOPLE)
    .then(res => res.json())
    .then(body => console.log(body))
}
